angular.module("uiSwitch", []).directive("switch", function () {
    return{restrict: "AE",
        replace: !0,
        transclude: !0,
        template: function (n, e) {
//            console.log(e)
            var s = "";
            s += "<span",
                    s += ' class="switch hidden-dom-removal' + (e.class ? " " + e.class : "") + '"',
                    s += e.ngDisable != 'true' ? " ng-click='" + e.ngModel + '=!' + e.ngModel + (e.ngChange ? '; ' + e.ngChange + '(\"' + e.name + "\")" : '') + (e.customclick ? "; " + e.customclick : '') + "'" : "",                    
                    s += ' ng-class="{ checked:' + e.ngModel + ' }"',
                    s += ">",
                    s += "<small></small>",
                    s += '<input type="checkbox"',
                    s += e.id ? ' id="' + e.id + '"' : "",
                    s += e.name ? ' name="' + e.name + '"' : "",
                    s += e.value ? ' name="' + e.value + '"' : "",
                    s += e.ngModel ? ' ng-model="' + e.ngModel + '"' : "",
                    s += ' style="display:none" />',
                    s += '<span class="switch-text">',
                    s += e.on ? '<span class="on">' + e.on + "</span>" : "",
                    s += e.off ? '<span class="off">' + e.off + "</span>" : " ",
                    s += "</span>";
            return s;
        }}
});